-- Table structure for `member`
-- ----------------------------
DROP TABLE IF EXISTS `member`;
CREATE TABLE `member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '用户名',
  `userpwd` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '用户密码',
  `nickname` varchar(30) CHARACTER SET utf8 DEFAULT NULL COMMENT '昵称',
  `tel` varchar(30) CHARACTER SET utf8 DEFAULT NULL COMMENT '手机',
  `qq` varchar(20) CHARACTER SET utf8 DEFAULT NULL,
  `sex` smallint(6) DEFAULT '0' COMMENT ' 1 男   2 女   0 未知 ',
  `age` smallint(6) DEFAULT '0' COMMENT '年龄',
  `regtime` datetime NOT NULL,
  `lastlogin` datetime DEFAULT NULL,
  `desc` varchar(300) CHARACTER SET utf8 DEFAULT NULL COMMENT '个人描述',
  `integral` int(11) DEFAULT '0' COMMENT '积分',
  `grade` varchar(30) CHARACTER SET utf8 DEFAULT NULL COMMENT '等级-头衔',
  `regtype` smallint(6) NOT NULL DEFAULT '0' COMMENT '0 未定义 1 WEB注册用户 2 客户端注册用户 3 锁定状态（无法进行登陆） 4 注销用户   5 删除数据',
  `picurl` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '图像地址URL',
  `email` varchar(200) DEFAULT NULL COMMENT '邮箱',
  PRIMARY KEY (`id`),
  KEY `mobile` (`username`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5917 DEFAULT CHARSET=latin1;

